import React from 'react';
import styled from 'styled-components';

//logo
import logo from '../assets/PneuS-03.png'

//image 
import mail from '../assets/Mail.png'
import facebook from '../assets/Facebook.png'
import phone from '../assets/phone.png'

//icons
import {GiPhone} from 'react-icons/gi'
import {MdMail} from 'react-icons/md'

const Styles = styled.div`
display:flex;
flex-direction:column;
align-items:center;
height:40vh;
font-size:16px;
.presentation{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    background-color:#eee;
    width:100%;
    height:30%;
    padding: 2% 0;
}
.coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:100%;
    height:70%;
    padding: 0 2%;
    margin-top:1%;
}
.card-coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:25%;
    height:100%;
    margin:0 1%;
    border-radius:10px;
}
.card-col-1{
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    width:30%;
    height:90%;
    background: rgba(199, 7, 7, 0.85);
    border-radius:50%
}
.card-col-2{
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    width:70%;
    height:100%;
}

`;
function underHeader() {
    return(
        <React.Fragment>
            <Styles>
                <div className='presentation'>
                   <img
                        src={logo}
                        width="120"
                        height="50"
                        className="logo"
                        alt="Logo Pneu service"
                    />
                    <p style={{fontSize:'1.3em', fontWeight:'500', color:'#555'}}>Leader de la vente en ligne des pneus multimarque en Alg√©rie.</p>
                </div>
                <div className='coordonnee'>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={facebook}
                                width="89"
                                height="105"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                            <p>pppp</p>
                        </div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={mail}
                                width="128"
                                height="125"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                        <p>pppp</p>
                        </div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={phone}
                                width="112"
                                height="115"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                        <p>pppp</p>
                        <p>pppp</p>
                        <p>pppp</p>
                        <p>pppp</p>
                        </div>
                    </div>
                </div>
            </Styles>
        </React.Fragment>
    )
}

export default underHeader;
